// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract AgentRegistry {
    struct AgentProfile {
        address agent;
        string platform;
        uint256 price;
        string location;
        string avatar;
        string description;
    }

    mapping(address => AgentProfile) public agents;
    address[] public agentList;

    event Registered(address indexed agent);
    event AgentProfileUpdated(address indexed agent, AgentProfile profile);

    function registerAsAgent(
        string memory platform,
        uint256 price,
        string memory location,
        string memory avatar,
        string memory description
    ) external {
        require(agents[msg.sender].agent == address(0), "Already registered");
        AgentProfile memory profile = AgentProfile(
            msg.sender, platform, price, location, avatar, description
        );
        agents[msg.sender] = profile;
        agentList.push(msg.sender);
        emit Registered(msg.sender);
        emit AgentProfileUpdated(msg.sender, profile);
    }

    function updateAgentProfile(
        string memory platform,
        uint256 price,
        string memory location,
        string memory avatar,
        string memory description
    ) external {
        require(agents[msg.sender].agent != address(0), "Not an agent");
        AgentProfile storage profile = agents[msg.sender];
        profile.platform = platform;
        profile.price = price;
        profile.location = location;
        profile.avatar = avatar;
        profile.description = description;
        emit AgentProfileUpdated(msg.sender, profile);
    }

    function getAgentProfile(address agent) external view returns (AgentProfile memory) {
        return agents[agent];
    }
}

